text = '%{
\n\n\nQUOTATIONS\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEven though we’ve been using these internally for some time and working on it for a few years, you still have butterflies in your stomach the week before…the night before introduction…the launch.… You never know until you get it into your customers’ hands and they tell you what they think. The feedback we’ve got has been off the charts. We think this is a profound game-changer. We think when people look back some number of years from now, they’ll see this as a major event in personal computation devices. What’s been really great for me is how quickly people have got it. You know, I’ve gotten a few thousand emails from people I’ve never talked to before just telling me how much they think this product is going to change their life and what they do. People are getting it very quickly.\n\nJune 13, 2017\n\u001c11\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAll we are is our ideas, or people. That’s what keeps us going to work in the morning, to hang around these great bright people. I’ve always thought that recruiting is the heart and soul of what we do.\n\nIn the end I want to make a brand that stands for mentoring. For next steps advising. Metaphor like Alfred (your help). Something like your guide or compass. Who grabs you by the hand and gives you the courage to take 1 then 2 steps. Maybe we call it step.\n\nJanuary 7, 2015\n\u001c12\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe’re not going to be the first to this party, but we’re going to be the best.\n\nJanuary 7, 2015\n\u001c16\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s not just recruiting. After recruiting, it’s building an environment that makes people feel they are surrounded by equally talented people and their work is bigger than they are. The feeling that the work will have tremendous influence and is part of a strong, clear vision—all those things.\n\nJanuary 7, 2015\n\u001c17\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe don’t stand a chance of advertising with features and benefits and with RAMs and with charts and comparisons. The only chance we have of communicating is with a feeling.\n\nJanuary 7, 2015\n\u001c18\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA lot of people in our industry haven’t had very diverse experiences. So they don’t have enough dots to connect, and they end up with very linear solutions without a broad perspective on the problem. The broader one’s understanding of the human experience, the better design we will have.\n\nI was thinking of maybe going to Andreas\u0027s and pitching my idea\n\nJanuary 7, 2015\n\u001c20\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you first start off trying to solve a problem, the first solutions you come up with are very complex, and most people stop there. But if you keep going, and live with the problem and peel more layers of the onion off, you can oftentimes arrive at some very elegant and simple solutions. Most people just don’t put in the time or energy to get there. We believe that customers are smart and want objects which are well thought through.\n\nJanuary 7, 2015\n\u001c28\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cReal artists ship.\n\nJanuary 7, 2015\n\u001c37\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBeing the richest man in the cemetery doesn’t matter to me.… Going to bed at night saying we’ve done something wonderful—that’s what matters to me.\n\nJanuary 7, 2015\n\u001c41\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo design something really well, you have to get it.\n\nJanuary 7, 2015\n\u001c42\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPeople judge you by your performance, so focus on the outcome. Be a yardstick of quality. Some people aren’t used to an environment where excellence is expected.\n\nJanuary 7, 2015\n\u001c48\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFocus People think focus means saying yes to the thing you’ve got to focus on. But that’s not what it means at all. It means saying no to the hundred other good ideas that there are. You have to pick carefully. I’m actually as proud of the things we haven’t done as the things I have done. Innovation is saying no to 1,000 things.\n\nJanuary 7, 2015\n\u001c52\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1FMhjJRzM4mostx63Pemm5pdaUEGTi0muLZNuZKE","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1tchcl8K8uB3MnO2qUfA4UvmVxmuYTbx7EyIzOeI","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}