.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4000,"ei":4016,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4017,"ei":4022,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="FI5fBINfZAWdFehwssNRFZV5zaY"  nonce="FI5fBINfZAWdFehwssNRFZV5zaY">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="FI5fBINfZAWdFehwssNRFZV5zaY"  nonce="FI5fBINfZAWdFehwssNRFZV5zaY">DOCS_modelChunk = [{"ty":"is","ibi":4023,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou need a very product-oriented culture, even in a technology company.\n\nJanuary 7, 2015\n\u001c53\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“Because I’m the CEO and I think it can be done.” And so they kind of begrudgingly did it. But then it was a big hit\n\nJanuary 8, 2015\n\u001c54\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 8, 2015\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you want to live your life in a creative way, as an artist, you have to not look back too much. You have to be willing to take whatever you’ve done and whoever you were and throw them away.\n\nJanuary 8, 2015\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLet’s go invent tomorrow rather than worrying about what happened yesterday.\n\nJanuary 8, 2015\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSo you have to listen very carefully. But then you have to go and sort of stow away—you have to go hide away with people that really understand the technology, but also really care about the customers, and dream up this next breakthrough. And that’s my perspective, that everything starts with a great product. And that has its flaws\n\nJanuary 8, 2015\n\u001c61\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI think the artistry is in having an insight into what one sees around them. Generally putting things together in a way no one else has before and finding a way to express that to other people who don’t have that insight…\n\nJanuary 8, 2015\n\u001c69\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe most important thing is a person . A person who incites and feeds your curiosity; and machines cannot do that in the same way that people can.\n\nIn my experience I agree! But I also think...what if you\u0027re wrong? What if I can not only incite, but also feed a person\u0027s curiosity? What would that take when there are so many students out there? A lot of empowered people...using technology. That I\u0027m gonna create. It\u0027ll be like what doctors use when they ask their standard questions.\n\nJanuary 8, 2015\n\u001c70\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy dream is that every person in the world will have their own Apple computer. To do that, we’ve got to be a great marketing company.\n\nEvery student will need to use grow. So we need to be a great marketing company too\n\nJanuary 8, 2015\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cInnovation has nothing to do with how many R\u0026D dollars you have. When Apple came up with the Mac, IBM was spending at least 100 times more on R\u0026D. It’s not about money. It’s about the people you have, how you’re led,\n\nJanuary 8, 2015\n\u001c97\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ctechnology married with liberal arts, married with the humanities, that yields us the result that makes our hearts sing.\n\nJanuary 8, 2015\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cyou really look at the ones that ended up being “successful” in the eyes of the society and the ones that didn’t, oftentimes it’s the ones [who] were successful loved what they did, so they could persevere when it got really tough. And the ones that didn’t love it quit because they’re sane, right?\n\nJanuary 8, 2015\n\u001c110\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthe only way to do great work is to love what you do.… Don’t settle\n\nJanuary 8, 2015\n\u001c110\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI’m convinced that about half of what separates the successful entrepreneurs from the non-successful ones is pure perseverance.… Unless you have a lot of passion about this, you’re not going to survive. You’re going to give it up. So you’ve got to have an idea, or a problem or a wrong that you want to right that you’re passionate about; otherwise, you’re not going to have the perseverance to stick it through.\n\nJanuary 8, 2015\n\u001c114\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen we create stuff, we do it because we listen to customers, get their inputs and also throw in what we’d like to see, too. We cook up new products. You never really know if people will love them as much as you do.\n\nJanuary 8, 2015\n\u001c122\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI feel like somebody just punched me in the stomach and knocked all my wind out. I’m only 30 years old and I want to have a chance to continue creating things. I know I’ve got at least one more great computer in me. And Apple is not going to give me a chance to do that.\n\nJanuary 9, 2015\n\u001c147\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy model for business is the Beatles. They were four guys who kept each other’s kind of negative tendencies in check. They balanced each other and the total was greater than the sum of the parts. That’s how I see business: great things in business are never done by one person, they’re done by a team of people.\n\nJanuary 9, 2015\n\u001c151\n\u0011\n\u0011"},{"ty":"te","id":"i.13","spi":4032},{"ty":"te","id":"i.14","spi":4140},{"ty":"te","id":"i.15","spi":4293},{"ty":"te","id":"i.16","spi":4328},{"ty":"te","id":"i.17","spi":4557},{"ty":"te","id":"i.18","spi":4670},{"ty":"te","id":"i.19","spi":5040},{"ty":"te","id":"i.20","spi":5298},{"ty":"te","id":"i.21","spi":5820},{"ty":"te","id":"i.22","spi":6075},{"ty":"te","id":"i.23","spi":6328},{"ty":"te","id":"i.24","spi":6486},{"ty":"te","id":"i.25","spi":6822},{"ty":"te","id":"i.26","spi":6927},{"ty":"te","id":"i.27","spi":7377},{"ty":"te","id":"i.28","spi":7631},{"ty":"te","id":"i.29","spi":7939},{"ty":"as","st":"paragraph","si":4023,"ei":4023,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4024,"ei":4024,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":4025,"ei":4025,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":4027,"ei":4027,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":4029,"ei":4029,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":4031,"ei":4031,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell