s_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":7598,"ei":7614,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":7634,"ei":7905,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":7906,"ei":7922,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":7942,"ei":8254,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8255,"ei":8271,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="FI5fBINfZAWdFehwssNRFZV5zaY"  nonce="FI5fBINfZAWdFehwssNRFZV5zaY">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="FI5fBINfZAWdFehwssNRFZV5zaY"  nonce="FI5fBINfZAWdFehwssNRFZV5zaY">DOCS_modelChunk = [{"ty":"is","ibi":8279,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c[Technology] doesn’t change the world. It really doesn’t. Technologies can make it easier, can let us touch people we might not otherwise. But it’s a disservice to constantly put things in a radical new light, that it’s going to change everything. Things don’t have to change the world to be important.\n\nJanuary 9, 2015\n\u001c152\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001chow do you tell somebody what you are, who you are, what you care about? And the best way we could think of was, you know, if you know who somebody’s heroes are, that tells you a lot about them.\n\nJanuary 9, 2015\n\u001c153\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnce you get into the problem…you see that it’s complicated, and you come up with all these convoluted solutions. That’s where most people stop, and the solutions tend to work for a while. But the really great person will keep going, find the underlying problem, and come up with an elegant solution that works on every level.\n\nJanuary 9, 2015\n\u001c154\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA lot of times, people don’t know what they want until you show it to them.\n\nJanuary 9, 2015\n\u001c154\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYour time is limited, so don’t waste it living someone else’s life. Don’t be trapped by dogma—which is living with the results of other people’s thinking. Don’t let the noise of others’ opinions drown our your own inner voice. And most important, have the courage to follow your heart and intuition. They somehow already know what you truly want to become. Everything else is secondary.\n\nJanuary 9, 2015\n\u001c155\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHow easy is this going to be for the user? How great it is going to be for the user?”\n\nJanuary 9, 2015\n\u001c159\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cZen Buddhism: It places value on experience versus intellectual understanding. I saw a lot of people contemplating things but it didn’t seem to lead to too many places. I got very interested in people who had discovered something more significant than an intellectual, abstract understanding.\n\nJanuary 9, 2015\n\u001c160\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe’re gambling on our vision, and we would rather do that than make “me, too” products. Let some other companies do that. For us, it’s always the next dream.\n\nJanuary 9, 2015\n\u001c161\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBill Gates said about six months ago. He said, “I worked really, really hard in my twenties.” And I know what he means, because I worked really, really hard in my twenties, too—seven days a week, lots of hours every day. But you can’t do it forever. You don’t want to do it forever.\n\nJanuary 9, 2015\n\u001c163\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 9, 2015\n\u001c164\n\u0011\n\u0011"}
}'


